// config route
// 1. route.config.js - File cấu hình routes
import HomePage from '../pages/HomePage';
import NotFoundPage from '../pages/NotFoundPage';

// create route and export 
export const routes = [
  {
    path: '/',
    element: <HomePage />,
    name: 'Trang Chủ'
  },
  {
    path: '/properties',
    element: "",
    name: 'Dự án'
  },
  {
    path: '/properties/:id',
    element:"",
    name: 'Chi Tiết Bất Động Sản'
  },
  {
    path: '/about',
    element: "",
    name: 'Dịch vụ'
  },
  {
    path: '/about',
    element: "",
    name: 'Tin tức'
  },
  {
    path: '/contact',
    element: "",
    name: 'Liên Hệ'
  },
  {
    path: '*',
    element: <NotFoundPage />,
    name: 'Không Tìm Thấy'
  }
];

export default routes;
